import React from "react";

const Blog=(state)=>{

    const {items,DeleteItem,handleSubmit,Edit}=state;
const loop=items.map(item=>{
return(

  <div key="item.id" className='adding_item'>

  <form type="submit" onSubmit={handleSubmit}>
   <p>{item.name}</p> 

 
  </form>
  </div>

)
}
)
  


  
    return (
<div key={loop}>{loop}
<div><button onClick={Edit}>Edit Course</button>

    
<button onClick={()=>DeleteItem()}>Delete Item</button></div>

</div>
   
  )      


}
export default Blog;
